/*Table structure for table `b_ business_income` */

DROP TABLE IF EXISTS `b_ business_income`;

CREATE TABLE `b_ business_income` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `year` varchar(4) DEFAULT NULL COMMENT '年份',
  `month` varchar(2) DEFAULT NULL COMMENT '月份',
  `date` varchar(2) DEFAULT NULL COMMENT '日期',
  `incomecategory` varchar(64) DEFAULT NULL COMMENT '收入类别',
  `money` decimal(10,2) DEFAULT NULL COMMENT '金额',
  `remark` varchar(256) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

