/*Table structure for table `b_daily_operating_expenses_cost` */

DROP TABLE IF EXISTS `b_daily_operating_expenses_cost`;

CREATE TABLE `b_daily_operating_expenses_cost` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `year` varchar(4) DEFAULT NULL COMMENT '年份',
  `month` varchar(2) DEFAULT NULL COMMENT '月份',
  `date` varchar(2) DEFAULT NULL COMMENT '日期',
  `costcategory` varchar(64) DEFAULT NULL COMMENT '支出类别',
  `money` decimal(10,2) DEFAULT NULL COMMENT '金额',
  `remark` varchar(256) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `b_daily_operating_expenses_cost` */

/*Table structure for table `b_employee info` */

DROP TABLE IF EXISTS `b_employee info`;

CREATE TABLE `b_employee info` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `code` varchar(16) DEFAULT NULL COMMENT '人员编码',
  `name` varchar(16) DEFAULT NULL COMMENT '人员姓名',
  `sex` varchar(2) DEFAULT NULL COMMENT '人员性别',
  `dateofbirth` varchar(16) DEFAULT NULL COMMENT '出生年月',
  `idnum` varchar(20) DEFAULT NULL COMMENT '身份证号',
  `contactnum` varchar(16) DEFAULT NULL COMMENT '联系方式',
  `address` varchar(256) DEFAULT NULL COMMENT '家庭住址',
  `worktime` varchar(16) DEFAULT NULL COMMENT '参加工作时间',
  `department` varchar(100) DEFAULT NULL COMMENT '所属部门',
  `position` varchar(100) DEFAULT NULL COMMENT '职位',
  `remark` varchar(256) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `b_employee info` */

/*Table structure for table `b_employee_cost` */

DROP TABLE IF EXISTS `b_employee_cost`;

CREATE TABLE `b_employee_cost` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `code` varchar(16) DEFAULT NULL COMMENT '人员编码',
  `year` varchar(4) DEFAULT NULL COMMENT '年份',
  `month` varchar(2) DEFAULT NULL COMMENT '月份',
  `basicsalary` decimal(10,2) DEFAULT NULL COMMENT '基本工资',
  `turnoutwork` int(6) DEFAULT NULL COMMENT '出勤',
  `mealsubsidy` decimal(10,2) DEFAULT NULL COMMENT '餐补',
  `trafficsubsidy` decimal(10,2) DEFAULT NULL COMMENT '交通补助',
  `othersubsidies` decimal(10,2) DEFAULT NULL COMMENT '其他补助',
  `bonus` decimal(10,2) DEFAULT NULL COMMENT '奖金',
  `endowmentinsurance` decimal(10,2) DEFAULT NULL COMMENT '养老保险',
  `unemploymentinsurance` decimal(10,2) DEFAULT NULL COMMENT '失业保险',
  `medicalinsurance` decimal(10,2) DEFAULT NULL COMMENT '医疗保险',
  `accumulationfund` decimal(10,2) DEFAULT NULL COMMENT '公积金',
  `personalincometax` decimal(10,2) DEFAULT NULL COMMENT '代缴个税',
  `debit` decimal(10,2) DEFAULT NULL COMMENT '扣款',
  `remark` varchar(256) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `b_employee_cost` */

