  `name` varchar(64) DEFAULT NULL COMMENT '字典名',
  `ordernum` int(11) DEFAULT NULL COMMENT '序号',
  `status` varchar(2) DEFAULT NULL COMMENT '状态',
  `remark` varchar(256) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

